import React from "react";
import styled from "styled-components";

const Div = styled.div`
	background-image: linear-gradient(to bottom, #0096c7, #0077b6, #14213d);
	border-radius: 30px;
	padding: 20px;
`;

const Li = styled.li`
	color: white;
	list-style: none;
	margin-bottom: 10px;
`;

todos = [
	{
		id: 1,
		text: "the first one",
	},
];
function Todos() {
	return (
		<Div>
			<ul>
				<Li>the first one </Li>
				<Li>the second one</Li>
				<Li>the third one</Li>
			</ul>
		</Div>
	);
}

export default Todos;
